const e=JSON.parse('{"key":"v-2fd62331","path":"/languages/java/thread/java/juc/threadQ.html","title":"线程池面试题","lang":"zh-CN","frontmatter":{"description":"线程池面试题 线程池都有哪些参数？ 这个问题是很好回答的，只要自己画过流程图，都能说出来，今天使用不同角度写一下每个参数的意义和容易错的点。 核心线程 最大线程 设置队列 拒绝策略 回收时间限制 core 核心线程，在接收请求时处理问题核心，当线程小于核心线程时，直接增加线程，一般情况下不会设置很大。 max 最大数量线程，当队列满的时候创建的最大线程，如果线程满了，处理任务数据还解决不了的话就需要考虑如何丢失任务策略。 而max不要使用Integer.MAX_VALUE。","head":[["meta",{"property":"og:url","content":"https://renfakai.com/languages/java/thread/java/juc/threadQ.html"}],["meta",{"property":"og:site_name","content":"天道酬勤"}],["meta",{"property":"og:title","content":"线程池面试题"}],["meta",{"property":"og:description","content":"线程池面试题 线程池都有哪些参数？ 这个问题是很好回答的，只要自己画过流程图，都能说出来，今天使用不同角度写一下每个参数的意义和容易错的点。 核心线程 最大线程 设置队列 拒绝策略 回收时间限制 core 核心线程，在接收请求时处理问题核心，当线程小于核心线程时，直接增加线程，一般情况下不会设置很大。 max 最大数量线程，当队列满的时候创建的最大线程，如果线程满了，处理任务数据还解决不了的话就需要考虑如何丢失任务策略。 而max不要使用Integer.MAX_VALUE。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-02-27T09:05:08.000Z"}],["meta",{"property":"article:modified_time","content":"2023-02-27T09:05:08.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"线程池面试题\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-02-27T09:05:08.000Z\\",\\"author\\":[]}"]]},"headers":[{"level":2,"title":"线程池都有哪些参数？","slug":"线程池都有哪些参数","link":"#线程池都有哪些参数","children":[]},{"level":2,"title":"core","slug":"core","link":"#core","children":[]},{"level":2,"title":"max","slug":"max","link":"#max","children":[]},{"level":2,"title":"丢弃任务策略","slug":"丢弃任务策略","link":"#丢弃任务策略","children":[]},{"level":2,"title":"队列","slug":"队列","link":"#队列","children":[]},{"level":2,"title":"回收时间","slug":"回收时间","link":"#回收时间","children":[]},{"level":2,"title":"结论","slug":"结论","link":"#结论","children":[]}],"git":{"createdTime":1677488708000,"updatedTime":1677488708000,"contributors":[{"name":"renfakai","email":"rfk1118@gmail.com","commits":1}]},"readingTime":{"minutes":2.86,"words":859},"filePathRelative":"languages/java/thread/java/juc/threadQ.md","localizedDate":"2023年2月27日","excerpt":"<h1> 线程池面试题</h1>\\n<h2> 线程池都有哪些参数？</h2>\\n<p>这个问题是很好回答的，只要自己画过流程图，都能说出来，今天使用不同角度写一下每个参数的意义和容易错的点。</p>\\n<ul>\\n<li>核心线程</li>\\n<li>最大线程</li>\\n<li>设置队列</li>\\n<li>拒绝策略</li>\\n<li>回收时间限制</li>\\n</ul>\\n<h2> core</h2>\\n<p>核心线程，在接收请求时处理问题核心，当线程小于核心线程时，直接增加线程，一般情况下不会设置很大。</p>\\n<h2> max</h2>\\n<p>最大数量线程，当队列满的时候创建的最大线程，如果线程满了，处理任务数据还解决不了的话就需要考虑如何丢失任务策略。\\n而max不要使用Integer.MAX_VALUE。</p>","copyright":{},"autoDesc":true}');export{e as data};
